import React from "react";

import styles from "./TemplateBlog.module.css";

const Blog = ({header, short_text, topic, date_posted}) => {
  return (
    <div class={styles.templateBlog}>
      <h1>{header}</h1>
      <p class={styles.shortText}>{short_text}</p>
      <div class={style.blogInfo}>
        <p>{topic}</p>
        <p>{date_posted}</p>
      </div>
    </div>
  )
}

export default Blog
